import React from "react";

class MyPerson extends React.Component {
    render() {
        return (
            <span>
                <h1>Thálisson Gonçalves da Silva</h1>
                <p>Tenho 20 anos, sou estudante de desenvolvimento web na Trybe, amo jogos, tecnologia e música, sou de Minas Gerais</p>
                <h2>Minhas habilidades</h2>
                <ul>
                    <li>HTML</li>
                    <li>CSS</li>
                    <li>JavaScript</li>
                    <li>Git</li>
                    <li>GitHub</li>
                </ul>
            </span>
        )
    }
}

export default MyPerson;
